import "./ExpenselItem.css";
import Expendelitem from "./Expenselitem.js";
function Expense(props){
  const data=[
    {id:"el1",title:"toilet paper",amount:283,data:new Date()},
    {id:"el2",title:"new tv",amount:383,data:new Date()},
    {id:"el3",title:"car insurance",amount:483,data:new Date()},
    {id:"el4",title:"new desk",amount:583,data:new Date()}
  ]
  return(
   <div className='app'>
      <Expendelitem data={data[0].data} title={data[0].title} amount={data[0]}></Expendelitem>
      <Expendelitem ></Expendelitem>
      <Expendelitem ></Expendelitem>
      <Expendelitem ></Expendelitem>
   </div>


  )
}
export default Expense;
